        <title>Range Prints</title>
        <script type="text/javascript">
            function printRange (rangeStart,rangeStop) {
            var text = "";
            for (var i = rangeStart; i<rangeStop; i++){
                text += i + ',';
            }
            return text;
            var result = text;
            }

        </script>
